import React from 'react'
import logo from './images/Podnet1.png'
import './Sidebar.css'

class SidebarContents extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            name: 'Tony Stark',
            password: 'IamIronMan'
        };

        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(event) {
        this.setState({value: event.target.value});
    }

    render() {
        return (
            <div>
                <div>
                    <img src={logo} alt="logo" class="logo-opacity" />
                </div>
            </div>
        )
    }
}

export default SidebarContents;
